          "distinct": true,
          "id": "6c9f2e42581c46f5218233cde27a5dc77e796b4b",
          "message": "fix: Use custom logger instead of modifying slog.Default logger (#68)\n\n## Summary\r\n\r\nOverwriting the default `slog` logger with\r\n`slog.SetDefault(defaultLogger)` is a global change to the `slog`\r\npackage, this means the change is leaked into the user's code base\r\nimporting `govy`.\r\n\r\nInstead of using the default `slog` logger we can instead expose the\r\ncustom logger from the `logging` package.\r\n\r\nFixes https://github.com/nobl9/govy/issues/66.\r\n\r\nAdditional changes:\r\n\r\n- Update devbox dependencies.\r\n- Update JS packages.\r\n\r\n## Testing\r\n\r\nTo reproduce:\r\n\r\n```go\r\npackage main\r\n\r\nimport (\r\n\t\"log/slog\"\r\n\r\n\t_ \"github.com/nobl9/govy/pkg/govy\"\r\n)\r\n\r\nfunc main() {\r\n\tslog.Info(\"INFO lvl msg\")\r\n\tslog.Error(\"Error lvl msg\")\r\n}\r\n```\r\n\r\n```go\r\nmodule simple\r\n\r\ngo 1.23\r\n\r\nrequire github.com/nobl9/govy v0.11.0\r\n\r\nrequire (\r\n\tgolang.org/x/exp v0.0.0-20240808152545-0cdaa3abc0fa // indirect\r\n\tgolang.org/x/mod v0.20.0 // indirect\r\n\tgolang.org/x/sync v0.8.0 // indirect\r\n\tgolang.org/x/tools v0.24.0 // indirect\r\n)\r\n```\r\n\r\n```sh\r\n$ go run main.go\r\n{\"time\":\"2025-02-02T16:18:07.580205173+01:00\",\"level\":\"ERROR\",\"msg\":\"Error lvl msg\",\"source\":{\"function\":\"main.main\",\"file\":\"/home/mh/projects/simple/main.go\",\"line\":11}}\r\n```\r\n\r\nAfter the fix:\r\n\r\n```go\r\nmodule simple\r\n\r\ngo 1.23\r\n\r\nrequire github.com/nobl9/govy v0.11.0\r\n\r\nreplace github.com/nobl9/govy v0.11.0 => github.com/nobl9/govy v0.11.1-0.20250202150754-8b51dcb1221e\r\n\r\nrequire (\r\n\tgolang.org/x/exp v0.0.0-20240808152545-0cdaa3abc0fa // indirect\r\n\tgolang.org/x/mod v0.20.0 // indirect\r\n\tgolang.org/x/sync v0.8.0 // indirect\r\n\tgolang.org/x/tools v0.24.0 // indirect\r\n)\r\n```\r\n\r\n```sh\r\n$ go run main.go\r\n2025/02/02 16:20:01 INFO INFO lvl msg\r\n2025/02/02 16:20:01 ERROR Error lvl msg\r\n```\r\n\r\n## Release Notes\r\n\r\nGovy no longer overwrites the default `slog` logger.",
