          "message": "chore: Update dependency gofumpt to v0.8.0 (#109)\n\nThis PR contains the following updates:\n\n| Package | Update | Change |\n|---|---|---|\n| [gofumpt](https://redirect.github.com/mvdan/gofumpt) | minor | `0.7`\n-> `0.8.0` |\n\n---\n\n### Release Notes\n\n<details>\n<summary>mvdan/gofumpt (gofumpt)</summary>\n\n###\n[`v0.8.0`](https://redirect.github.com/mvdan/gofumpt/blob/HEAD/CHANGELOG.md#v080---2025-04-13)\n\nThis release is based on Go 1.24's gofmt, and requires Go 1.23 or later.\n\nThe following changes are included:\n\n- Fail with `-d` if formatting any file resulted in a diff -\n[#&#8203;114](https://redirect.github.com/mvdan/gofumpt/issues/114)\n- Do not panic when a `go.mod` file is missing a `go` directive -\n[#&#8203;317](https://redirect.github.com/mvdan/gofumpt/issues/317)\n\n</details>\n\n---\n\n### Configuration\n\n **Schedule**: Branch creation - At 12:00 AM through 04:59 AM and 10:00\nPM through 11:59 PM, Monday through Friday ( * 0-4,22-23 * * 1-5 ), Only\non Sunday and Saturday ( * * * * 0,6 ) (UTC), Automerge - At any time\n(no schedule defined).\n\n **Automerge**: Enabled.\n\n **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\n **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/nobl9/govy).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MC43LjEiLCJ1cGRhdGVkSW5WZXIiOiI0MC43LjEiLCJ0YXJnZXRCcmFuY2giOiJtYWluIiwibGFiZWxzIjpbImRlcGVuZGVuY2llcyIsInJlbm92YXRlIl19-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
